  [],\n\t\"revision_timestamp\": \"2016-07-27T23:03:13.834423\",\n\t\"name\": \"great-blue-heron-double-crested-cormorant-and-great-egret-nesting-missisquoi-national-2008\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"During 2008-2014, the staff of Missisquoi
  NWR continued to observe and monitor the annual nesting activity of colonial nesting
  waterbirds, at the Shad and Metcalfe Island Rookery, as well in other parts of the
  refuge. From ice-out (usually in late March) to August, weekly observations by boat
  were made to determine: (1) where great blue herons, double-crested cormorants,
  and great egrets were nesting, (2) disturbances to the birds or the rookery areas,
  (3) if abandonment of nests was occurring, and (4) the success/failure of double-crested
  cormorants to raise young to fledglings. In addition, post-season rookery nest counts
  were done each fall (after the leaves were off of the trees) to determine how many
  great blue heron, double-crested cormorant, and great egret nests occurred on the
  refuge during a given year.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
